const PlayfairDisplayRegular = `@font-face { font-family: 'Playfair Display'; font-style: normal; font-weight: 400; src: local('Playfair Display Regular'), local('PlayfairDisplay-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const PlayfairDisplayItalic = `@font-face { font-family: 'Playfair Display'; font-style: italic; font-weight: 400; src: local('Playfair Display Italic'), local('PlayfairDisplay-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const PlayfairDisplay700 = `@font-face { font-family: 'Playfair Display'; font-style: normal; font-weight: 700; src: local('Playfair Display Bold'), local('PlayfairDisplay-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const PlayfairDisplay700italic = `@font-face { font-family: 'Playfair Display'; font-style: italic; font-weight: 700; src: local('Playfair Display Bold Italic'), local('PlayfairDisplay-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const PlayfairDisplay900 = `@font-face { font-family: 'Playfair Display'; font-style: normal; font-weight: 900; src: local('Playfair Display Black'), local('PlayfairDisplay-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
const PlayfairDisplay900italic = `@font-face { font-family: 'Playfair Display'; font-style: italic; font-weight: 900; src: local('Playfair Display Black Italic'), local('PlayfairDisplay-BlackItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
